import React from 'react';

import NumberDisplay from "./numberdisplay"
import "./tridata.css"

class Tridata extends React.Component {
    render () {
        return <div className="container" style={{ width: this.props.width + "px", height: this.props.height + "px" }}>
            <canvas ref="canvas_update" className="" width={this.props.width} height={this.props.height} />
            <canvas ref="canvas_background" className="" width={this.props.width} height={this.props.height} />

        </div>
    }
}

export default Tridata;
